import {initialState} from './inventoryAPI';


export const loadData = (data) => {
    return {
      type: 'inventory/loadData',
      payload: initialState,
    };
};
const fake = [];

export const allCategoriesSelector = (state) => {
    return state;
}
export const inventoryReducer = (inventory = fake, action) => {
    switch (action.type) {
      case 'inventory/loadData': {
        return action.payload;
      }
      default: {
        return inventory;
      }
    }
  };


export default inventoryReducer;
